import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Typography,
    Grid,
    Divider,
    Avatar
} from '@material-ui/core';
import { StatusBullet } from 'components';
import { URI } from './../../../../constants/types';
import styles from './styles';

const statusColors = {
    true: 'success',
    false: 'danger'
};
const PresencesCard = props => {
    const { className, classes } = props;
    return (
        <Card className={clsx(classes.root, className)}>
            <Grid container direction="row">
                <Grid item lg={2} md={6} xs={12}>
                    <CardHeader
                        avatar={
                            <Avatar
                                src={
                                    'http://www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=retro'
                                }
                            />
                        }
                        title={
                            <Typography variant="h5">
                                He thong thong tin
                            </Typography>
                        }
                        subheader={
                            <Typography variant="body2">by She Fen</Typography>
                        }
                    />
                </Grid>
                <Grid item xs>
                    <CardContent>
                        <Grid
                            container
                            direction="row"
                            //justify="space-between"
                            //alignItems="center"
                        >
                            <Grid item xs>
                                <Typography variant="h5" color="textPrimary">
                                    12
                                </Typography>
                                <Typography
                                    variant="body1"
                                    color="textSecondary"
                                >
                                    Chua biet
                                </Typography>
                            </Grid>
                            <Grid item xs>
                                <Typography variant="h5" color="textPrimary">
                                    12
                                </Typography>
                                <Typography
                                    variant="body1"
                                    color="textSecondary"
                                >
                                    Total Member
                                </Typography>
                            </Grid>
                        </Grid>
                    </CardContent>
                </Grid>
            </Grid>
        </Card>
    );
};
export default withStyles(styles)(PresencesCard);
